import React, { Component } from 'react';
import Layout from '../../../../layouts/mainLayout/MainLayout';
import Header from '../../../../../pageSettings/header/Header';

export default class ProductsMOTHERBOARD extends Component {
  state = {
    products: [],
   
   
    
    memory: '',
    form_factor: '',
    expansion_slots: '',
    M2Slot: '',
  };
  async getProducts() {
    const response = await fetch('http://localhost:5000/getData/motherboard');
    const result = await response.json();
    console.log(result);
    this.setState({ products: result });
  }

  componentDidMount() {
    this.getProducts();
  }

  render() {
    return (
      <Layout>
        <Header h1Heading='Motherboard Products' />
        {this.state.products.map((product, index) => {
          return (
            <div key={index}>
              <h3>{product.model}</h3>
              <h3>{product.cpu_socket_support}</h3>
              <h3>{product.chipset}</h3>
              
              <h3>{product.M2Slot}</h3>

              <h3>{product.form_factor}</h3>
            </div>
          );
        })}
      </Layout>
    );
  }
}
